import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Box from '@material-ui/core/Box';
import { useState } from 'react';
import { makeStyles } from '@material-ui/core';

const arrayOfYear = [2021, 2020, 2019]
const arrayOfMonth = ["Janeiro", "Fevereiro", "Março", "Abril", "Maio", "Junho", "Julho", "Agosto", "Setembro", "Outubro", "Novembro", "Dezembro"]

const useStyles = makeStyles({
    box: {
        marginTop: "30px",       
    },
    select: {
        minWidth: "120px",
        marginLeft: '36px',
    }
})

export default function DateSelector() {  

    const [day, setDay] = useState('')
    const [year, setYear] = useState('')

    const classes = useStyles()

    return (

        <div className={classes.box}>
            <FormControl variant="standard" className={classes.select}>
                <InputLabel width='' id="combo-age">Ano</InputLabel>
                <Select labelId="combo-age" id="select-age" value={year} onChange={(e) => setYear(e.target.value)}>
                    {
                        arrayOfYear.map(year => 
                            <MenuItem key={year} value={year}>{year}</MenuItem>)
                    }
                </Select>
            </FormControl>

            <FormControl variant="standard" className={classes.select}>
                <InputLabel id="combo-month">Mês</InputLabel>
                <Select labelId="combo-month" id="select-day" value={day} onChange={(e) => setDay(e.target.value)}>
                    {
                        arrayOfMonth.map(month => 
                            <MenuItem key={month} value={month}>{month}</MenuItem>)
                    }
                </Select>
            </FormControl>
        </div>
    )
}
